INSERT INTO tourdestination VALUES
('066e3c43-2420-4013-8084-a2cfb841697a', '898f441c-899a-4ba2-bf6f-d20ebbd1b738', 'aafd4df7-4887-437a-9122-dab9bf93722e', 'Chùa Bái Đính', 'Gia Sinh, Gia Viễn, Ninh Bình', 'Là ngôi chùa rộng nhất nước ta, Chùa Bái Đính có diện tích lên đến 539ha, trong đó khu chùa Bái Đính mới rộng 80ha và khu chùa cổ rộng 27ha cùng các công trình khác. Tổng thể kiến trúc của Chùa Bái Đính ngày nay được xem như một quy chuẩn, thước đo chuẩn mực cho kiến trúc chùa cổ ở Việt Nam.\nChùa Bái Đính mới hiện nay có quy mô rộng hơn với nhiều công trình kiến trúc nổi tiếng như Cổng tam quan, Gác chuông, Điện Quán Âm, Điện Giáo Chủ, Điện Tam Thế, Bảo tháp, Hành lang La Hán, v.v. Đồng thời, chùa cũng là nơi được vinh danh nhiều cái ‘nhất’ hiện nay, bao gồm: chùa có tượng Phật bằng đồng dát vàng lớn nhất châu Á, chùa có tượng Phật Di lặc bằng đồng lớn nhất Đông Nam Á, chùa có chuông đồng lớn nhất Việt Nam, có Bảo tháp cao nhất châu Á, có khu chùa rộng nhất việt Nam, hành lang La Hán dài nhất châu Á, v.v', '{"Adult": 0, "Child": 0, "Baby": 0}', 0, 'Tỉnh Ninh Bình', 'Huyện Gia Viễn'),
('252b211f-771a-41c3-a7b3-8873db9264b6', '898f441c-899a-4ba2-bf6f-d20ebbd1b738', 'e5e53257-6fd3-4d60-b394-2bafc7c791c4', 'Hang Múa - Ninh Bình', 'thôn Khê Đầu Hạ, Hoa Lư, Ninh Bình', 'Với kinh nghiệm du lịch Hang Múa – Ninh Bình cho thấy nơi đây không dành cho những người lười vận động. Với gần 500 bậc đá từ chân núi lên đỉnh Hang Múa, đây sẽ là cả một nỗ lực lớn để rồi bạn nhận lại thành quả là phong cảnh tuyệt mĩ vùng núi non sông nước Ninh Bình từ trên cao.\n\nBởi sẽ thật phí nếu đến đây mà không tự mình trải nghiệm hành trình leo bậc thang từ cuối lên đến đỉnh. Trong suốt hành trình, chính những khung cảnh núi đá, cánh đồng xung quanh đã tạo ra một bức tranh hùng vĩ không khác gì tiên cảnh. Dừng chân ở bất kỳ địa điểm nào bạn cũng có thể cho ra được những tấm ảnh so deep siêu lung linh', '{"Adult": 100000, "Child": 50000, "Baby": 0}', 0, 'Tỉnh Ninh Bình', 'Huyện Hoa Lư'),
('9f72440d-355b-4333-9838-f768e710b270', '898f441c-899a-4ba2-bf6f-d20ebbd1b738', 'e5e53257-6fd3-4d60-b394-2bafc7c791c4', 'Khu du lịch Tràng An - Ninh Bình', 'Tràng An, Hoa Lư, Ninh Bình', 'Khu du lịch Tràng An Ninh Bình có gì hẳn đó chính là vẻ đẹp tổng hòa, giao hợp giữa núi, non nước và họa thêm vào đó là ánh nắng lấp lánh của mặt trời lên màu nước. Đó thực sự là một cảnh đẹp ấn tượng, rung động bởi “non nước hữu tình”\nNgoài vẻ đẹp tuyệt vời của thiên nhiên thì quần thể kiến trúc của chùa đền cũng là địa điểm không nên bỏ qua khi tới Ninh Bình. Những bức tượng phật đúc bằng đồng quy mô lớn và vô cùng nổi tiếng như 500 vị la hán, đó là một không gian đẹp, cổ kính và linh thiêng.\nĐến với nơi đây du khách như đã “lạc” vào động xanh tại hàng cốc Bích Động Thật đúng như tên gọi bởi nó mang một vẻ đẹp ấn tượng, thu hút và gây choáng ngợp cho du khách. Đây đã trở thành một địa điểm “sống ảo” khó có thể bỏ qua của các bạn trẻ.', '{"Adult": 200000, "Child": 100000, "Baby": 0}', 1, 'Tỉnh Ninh Bình', 'Huyện Hoa Lư');
